import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on account dropdown
    await page.waitForSelector('.account-lists', { timeout: 5000 });
    await page.click('.account-lists');

    // Wait for profile link and click it
    await page.waitForSelector('text=Your Profile', { timeout: 5000 });
    await page.click('text=Your Profile');

    // Wait for profile page to load
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Take screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile.png'));

    // Extract profile information
    const extractedData = await page.evaluate(() => {
      const fullName = document.querySelector('.profile-info h2')?.innerText;
      const username = document.querySelector('.username')?.innerText;
      return { fullName, username };
    });

    return {
      success: true,
      action: "Navigated to Jun's Profile by clicking account dropdown and selecting profile",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
